import React, {useState} from "react";
import ThemeChanger from "./components/ThemeChanger";

const App = () => {
	const [open, setOpen] = useState(false);

	return (
			<div>
				<ThemeChanger open={open} setOpen={setOpen}/>

			</div>
	);
}

export default App;
